// BTech IT/CS Level Questions focusing on Computer Science and Information Technology
export const btechCSQuestions = [
    {
      question: "Which data structure is used for implementing recursion?",
      options: ["Queue", "Stack", "Array", "List"],
      correctAnswer: "Stack",
    },
    {
      question: "What is the time complexity of the best sorting algorithm in the average case?",
      options: ["O(n)", "O(n log n)", "O(n²)", "O(log n)"],
      correctAnswer: "O(n log n)",
    },
    {
      question: "Which of the following is not a principle of OOP?",
      options: ["Inheritance", "Encapsulation", "Polymorphism", "Normalization"],
      correctAnswer: "Normalization",
    },
    {
      question: "What does ACID stand for in database systems?",
      options: [
        "Atomicity, Consistency, Isolation, Durability",
        "Aggregation, Concurrency, Isolation, Durability",
        "Atomicity, Concurrency, Inheritance, Durability",
        "Aggregation, Consistency, Inheritance, Dependency",
      ],
      correctAnswer: "Atomicity, Consistency, Isolation, Durability",
    },
    {
      question: "Which of the following is not a valid HTTP status code?",
      options: ["200 OK", "404 Not Found", "500 Internal Server Error", "600 Server Timeout"],
      correctAnswer: "600 Server Timeout",
    },
    {
      question: "What is the primary purpose of a Primary Key in a database?",
      options: [
        "To uniquely identify records",
        "To establish relationships between tables",
        "To index the database for faster searching",
        "To ensure data consistency",
      ],
      correctAnswer: "To uniquely identify records",
    },
    {
      question: "Which of the following is not a layer in the TCP/IP model?",
      options: ["Application Layer", "Transport Layer", "Session Layer", "Internet Layer"],
      correctAnswer: "Session Layer",
    },
    {
      question: "What is the output of the following code snippet? int x = 5; System.out.println(x++ + ++x);",
